import React, { useState } from 'react';
import NavBarView from '../components/NavBarView';
import { Box, Card, CardContent, Grid, IconButton, TextField, Typography } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import MicIcon from '@mui/icons-material/Mic';
import AddIcon from '@mui/icons-material/Add';
import orange from '../assets/orngge.jpg';
import apple from '../assets/apple.jpg';
import mango from '../assets/mango.jpg';
import discount from '../data/discount.json';
import Footer from '../components/Footer';
import { useNavigate } from 'react-router-dom';

function Home_page() {
  const navigate = useNavigate();
  const [cart, setCart] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');

  const getDetails = () => {
    navigate('/myCart');
  };

  const addToCart = (item) => {
    setCart([...cart, item]);
  };

  // Filter fruits based on the search query
  const filteredFruits = discount.filter((fruit) => fruit.name.toLowerCase().includes(searchQuery.toLowerCase()));

  return (
    <>
      <NavBarView />
      <Box sx={{ width: '100%', height: '185vh', position: 'relative' }}>
        <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column', width: '100%', height: { md: '50vh', xs: '30vh' }, backgroundImage: 'url("https://image.slidesdocs.com/responsive-images/background/fruit-fresh-grapes-apples-powerpoint-background_49ff0c56af__960_540.jpg")', backgroundSize: 'cover', backgroundColor: 'transparent', position: 'absolute' }}>
          <br />
          <br />
          <Typography sx={{ fontSize: '70px', color: 'white', fontWeight: 'bold' }}>Good For You</Typography>
          <Typography sx={{ fontSize: '70px', color: 'white', fontWeight: 'bold' }}>Great For Life...</Typography>
          <Box sx={{}}>
            <IconButton aria-label="search">
              <SearchIcon />
            </IconButton>
            <TextField
              sx={{}}
              label="Search"
              size="small"
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
            />
            <IconButton aria-label="voice">
              <MicIcon />
            </IconButton>
          </Box>
        </Box>
        <Box sx={{ position: 'absolute', marginTop: { md: '50vh', xs: '30vh' }, background: 'linear-gradient(0deg, rgba(10,34,56,1) 0%, rgba(198,194,192,1) 0%, rgba(166,163,160,1) 23%, rgba(180,128,67,1) 42%, rgba(166,102,37,1) 74%, rgba(138,91,9,1) 100%)', width: '100%' }}>
          <Box sx={{ width: '100%', display: 'flex', justifyContent: 'center', alignItems: 'center', marginTop: '12px', fontSize: '40px', color: 'white' }}>Category</Box>
          <br />
          <Box sx={{ width: '100%', flexGrow: '1', display: 'flex', justifyContent: 'center' }}>
            <Grid container spacing={2} sx={{ width: '80%' }}>
              {filteredFruits.map((fruit) => (
                <Grid item md={4} xs={4} key={fruit.name} sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column' }}>
                  <img src={fruit.image} style={{ borderRadius: '50%' }} width='70%' height='auto' alt={fruit.name} />
                  <Typography sx={{ color: 'white', fontSize: { md: '30px', xs: '14px' } }}>{fruit.name}</Typography>
                </Grid>
              ))}
            </Grid>
          </Box>
          <br />
          <Box sx={{ width: '100%', display: 'flex', justifyContent: 'center', alignItems: 'center', marginTop: '12px', fontSize: '40px', color: 'white' }}>Special Discount</Box>
          <br />
          <Box sx={{ width: '100%', flexGrow: '1', display: 'flex', justifyContent: 'center' }}>
            <Grid container spacing={2} sx={{ width: '80%' }}>
              {discount.map((discount) => (
                <Grid item md={4} xs={4} key={discount.name} sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column' }}>
                  <Card>
                    <CardContent>
                      <img src={discount.image} width='100%' height='300hv' alt={discount.name} />
                      <Box sx={{ flexGrow: '1', width: '100%' }}>
                        <Grid container spacing={1}>
                          <Grid item md={7} xs={12}>
                            <Typography sx={{ fontSize: { md: '20px', xs: '10px' }, fontWeight: ' bold' }}>{discount.name}</Typography>
                            <Typography>{discount.discount}</Typography>
                          </Grid>
                          <Grid item md={5} xs={12} sx={{ display: 'flex', justifyContent: 'end' }}>
                            <IconButton onClick={getDetails}>
                              <AddIcon sx={{ background: 'brown', borderRadius: '50%', color: 'black' }} />
                            </IconButton>
                          </Grid>
                        </Grid>
                      </Box>
                    </CardContent>
                  </Card>
                </Grid>
              ))}
            </Grid>
          </Box>
          <br />
          <br />
          <br />
        </Box>
      </Box>
      <Footer />
    </>
  );
}

export default Home_page;
